import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
import { Facebook, Twitter } from "react-feather";

function Navbar(props) {
  let { home, login, sign, social } = props;

  return (
    <div className="navbar-container">
      <div className="navbar-left-items">
        <div className="navbar-buttons">
          {home && (
            <div className="navbar-btn  btn-login">
              <Link className="navbar-link-item" to="/">
                Anasayfa
              </Link>
            </div>
          )}
        </div>
      </div>
      <div className="navbar-mid-items">
        <Link to="/">
          <img className="logo-img" src="./images/logo-img.png" />
        </Link>
      </div>
      <div className="navbar-right-items">
        <div className="navbar-buttons">
          {login && (
            <div className="navbar-btn  btn-login">
              <Link className="navbar-link-item" to="/login">
                Giriş yap
              </Link>
            </div>
          )}
          {sign && (
            <div className="navbar-btn  btn-navbar-sign">
              <Link className="link-item" to="/sign">
                Kayıt ol
              </Link>
            </div>
          )}
          {social && (
            <div className="social-container">
              <Facebook />
              <Twitter />
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Navbar;
